import './App.css';
import { Navbar } from './components/Navbar/Navbar';
import './components/ItemListContainer';
import { ItemListContainer } from './components/ItemListContainer';
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
 return (
  <div>

    <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route></Route>
      </Routes>
      <ItemListContainer/>
    </BrowserRouter>

  </div>
 );
}

export default App;
